import { useEffect, useState } from "react";
import { Container } from "react-bootstrap";
import Header from "../../components/header/Header";
import * as S from './Home.style'
const Home = () => {
const [data, setData] = useState([])
    var storedArray = localStorage.getItem("items_dados");
    var arr = JSON.parse(storedArray)

    useEffect(()=>
   {
    arr && setData({arr})
   },[arr])


    console.log("items", data)
    return (
        <S.Content>
            <Header />
            <Container>
                {data?.map((item)=>{
                    return(
                        <div className="listItem">
                            <img src={item.file}/>
                            <p>{item.marca}</p>
                            <p>{item.ano}</p>
                            <p>{item.modelo}</p>
                            <p>{item.placa}</p>
                        </div>
                    )
                })}
            </Container>
        </S.Content>

    )
}

export default Home;
